// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link as RouterLink } from 'react-router-dom';
import Chat from './Chat';
import { Container, Typography, Button, Paper, Box } from '@mui/material';

const App = () => {
  return (
    <Router>
      <Container style={{ paddingRight: '0rem', paddingLeft: '0rem', marginTop: '0rem' }}>
        <Paper elevation={4} style={{ padding: '0rem', marginTop: '0rem' }}>
          <Routes>
            <Route path="/jeremy" element={<Chat user="Jeremy" />} />
            <Route path="/kasey" element={<Chat user="Kasey" />} />
            <Route path="/" element={
              <div>
                <Typography variant="h4" align="center" gutterBottom>
                  Select a user to start chatting
                </Typography>
                <Box display="flex" justifyContent="center" gap={2} mt={2}>
                  <Button component={RouterLink} to="/jeremy" variant="contained" color="primary">
                    Jeremy
                  </Button>
                  <Button component={RouterLink} to="/kasey" variant="contained" color="secondary">
                    Kasey
                  </Button>
                </Box>
              </div>
            } />
          </Routes>
        </Paper>
      </Container>
    </Router>
  );
};

export default App;
